import React, { useState } from 'react';
import "./processsim_style.css"


interface Params{
    back_button:()=>void
}

function ProcessSim({back_button}:Params){

    return <div className='processsim-page'>
        <button onClick={back_button} id='back'>Back</button>
        <div className='process-pid-select'>
            <p>Proceess pid: </p><div className='trgt-pid'>234</div>
            <div>
                <button className='sim-buttons'>New</button>
                <button className='sim-buttons'>Stop</button>
                <button className='sim-buttons'>Ready</button>
                <button className='sim-buttons'>Kill</button>
            </div>
        </div>
        {/* <Tree edges={edges} nodes={nodes}></Tree> */}
    </div>
}

export default ProcessSim;
